class STAT_CELL {
    static Map<String, STAT_CELL> name_map = new HashMap();
    String name;
    long value;
    STAT_CELL(String name) {
        this.name = name;
        name_map.put(name, this);
    }

    STAT_CELL(String name, long value) {
        this.name = name;
        this.value = value;
    }
}
    

